data.value:
Użytkownik jest zobowiązany do wyposażenia oprogramowania i jego funkcji (w tym m.in. do tworzenia nowych instancji) w konfigurację sprzętową i programową wymaganą przez użytkownika.
Użytkownicy są odpowiedzialni za uiszczenie odpowiednich opłat za korzystanie z usług telefonicznych i szerokopasmowych, które należy uiścić po połączeniu się z Internetem.
Użytkownik ponosi odpowiedzialność prawną za zachowanie, zdarzenie i wynik spowodowany korzystaniem z tego oprogramowania.
Wszelkie transakcje i spory między użytkownikami a innymi nieautoryzowanymi nieoficjalnymi osobami nie mają nic wspólnego z programistą.
Użytkownik jest zobowiązany do przestrzegania odpowiednich przepisów ustawowych i wykonawczych Chińskiej Republiki Ludowej (jeśli użytkownik jest użytkownikiem spoza Chińskiej Republiki Ludowej, użytkownik jest również zobowiązany do przestrzegania praw i przepisów obowiązujących w kraju lub regionie, do którego należy).
Użytkownik nie może używać oprogramowania (lub niektórych cech i funkcji oprogramowania) do angażowania się w działania niezgodne z prawem, a także nie może wykorzystywać odpowiednich procesów i usług związanych z oprogramowaniem do angażowania się w działania niezgodne z prawem, a konsekwencje jakichkolwiek działań nie są związane z programistą.
Użytkownicy ponoszą własną odpowiedzialność prawną związaną z treścią publikowanych przez nich informacji. Użytkownik nie może wprowadzać, publikować ani rozpowszechniać żadnej z następujących treści w oprogramowaniu, procesach i usługach związanych z działaniem oprogramowania, a także nie może publikować żadnej z następujących treści w żadnej formie：

sprzeciwianie się podstawowym zasadom zawartym w Konstytucji Chińskiej Republiki Ludowej;
zagrażanie bezpieczeństwu narodowemu, ujawnianie tajemnic państwowych, podważanie władzy państwowej lub podważanie jedności narodowej;
godzenie w honor i interesy państwa;
podżeganie do nienawiści etnicznej, dyskryminacji etnicznej lub podważanie jedności etnicznej;
podważanie krajowej polityki religijnej, propagowanie kultów i feudalnych przesądów;
rozpowszechnianie plotek, zakłócanie porządku społecznego lub podważanie stabilności społecznej;
Rozpowszechnianie treści obscenicznych, pornografii, hazardu, przemocy, morderstw, terroru lub podżegania do przestępstw;
obrażanie lub oczernianie innych osób, naruszanie słusznych praw i interesów innych osób;
Zawiera inne treści zabronione przez Chińską Republikę Ludową lub przepisy administracyjne.
O ile nie jest to dozwolone przez prawo lub nie ma pisemnej zgody programisty, użytkownicy nie mogą angażować się w żadne z poniższych działań：
Nielegalne lub niewłaściwe korzystanie z Oprogramowania i Usług;
Zakłócać normalnego działania systemu oprogramowania lub strony internetowej, celowo rozpowszechniać wirusów komputerowych i innych destrukcyjnych programów;
Podejmować jakichkolwiek nietypowych zachowań związanych z użytkowaniem, które mogą mieć wpływ na usługi sieciowe Oprogramowania (w tym między innymi uszkadzania, atakowania serwera lub przeciążania serwera itp.);
Usunąć informacje o prawach autorskich z Oprogramowania i jego kopii.

Jeśli użytkownik dopuści się jakiegokolwiek zachowania, które narusza przepisy prawa i regulacje lub narusza postanowienia niniejszej Umowy, deweloper ma prawo podjąć środki przeciwko użytkownikowi w zależności od powagi sytuacji, zgodnie z niniejszą Umową oraz przepisami ustawowymi i wykonawczymi, w tym między innymi do zakończenia świadczenia usług. Jeżeli okoliczności są poważne, zostaną oni przekazani odpowiednim organom administracyjnym w celu wymierzenia kary administracyjnej lub zostaną wszczęte dochodzenie w sprawie odpowiedzialności karnej.

Jeśli użytkownik wyrazi zgodę na niniejsze Warunki użytkowania i będzie korzystał z usług online Oprogramowania, będziemy gromadzić następujące informacje：
adres IP urządzenia, na którym uruchomione jest Oprogramowanie (który może nie być prawidłowym adresem);
Niektóre informacje systemowe sprzętu, na którym działa Oprogramowanie;
W przypadku awarii oprogramowania dzienniki oprogramowania uruchomionego w systemie (w tym niektóre informacje o systemie) mogą zostać przesłane za zgodą użytkownika, aby pomóc w rozwiązaniu problemu i ulepszeniu oprogramowania.
Inne informacje, które zostaną przesłane za zgodą użytkownika (zgodnie z opisem w oprogramowaniu).

1. Zawieszenie i zakończenie świadczenia usługi przez Użytkownika

W przypadku, gdy użytkownik publikuje informacje o charakterze bezprawnym, rażąco narusza dobre obyczaje lub narusza zakazy wynikające z przepisów prawa, deweloper zaprzestanie świadczenia usług na rzecz użytkownika;
Jeśli użytkownik dopuści się niewłaściwego działania podczas akceptowania usługi oprogramowania, programista ma prawo do zakończenia usługi świadczonej użytkownikowi (konkretne okoliczności niewłaściwego zachowania są wyraźnie określone w niniejszej umowie);
W przypadku korzystania przez użytkownika ze zmodyfikowanej wersji oprogramowania od osoby trzeciej, użytkownik ponosi własne ryzyko i odpowiedzialność prawną.

2. Zawieszenie, zawieszenie i zakończenie działania Oprogramowania i Usług：

W przypadku zaistnienia którejkolwiek z poniższych okoliczności, programista ma prawo zakończyć lub przerwać świadczenie całości lub części usług związanych z oprogramowaniem, a programista nie ponosi odpowiedzialności wobec użytkownika ani żadnej osoby trzeciej za niedogodności lub szkody z tego powodu wynikające：

a. zgodnie z wymaganiami Oprogramowania i Usług;
b. Nieprawidłowe działanie z powodu uszkodzenia serwera;
c. Z powodu nagłej awarii oprogramowania i sprzętu komputerowego oraz sprzętu do komunikacji elektronicznej;
d. z powodu awarii linii dostawcy sieci lub innych awarii;
e. ze względów politycznych;
f. Przyczyny osób trzecich lub inne okoliczności siły wyższej.

Programista zastrzega sobie prawo do zakończenia lub częściowego zakończenia Oprogramowania i Usług, gdy uzna to za konieczne, a Deweloper może powiadomić o tym Użytkownika w formie komunikatu, ale Deweloper nie ponosi odpowiedzialności za jakiekolwiek straty wyrządzone Użytkownikowi.

Niniejsza Umowa podlega prawu Chińskiej Republiki Ludowej, bez względu na wszelkie przepisy kolizyjne;
Niewykonanie, niewykonanie w odpowiednim czasie lub niepełne wykonanie przez Dewelopera praw przysługujących mu na mocy niniejszej Umowy lub zgodnie z prawem nie będzie uważane za zrzeczenie się wykonywania takich praw ani nie będzie miało wpływu na wykonywanie tych praw przez Dewelopera w przyszłości;
W zakresie dozwolonym przez prawo Deweloper ma prawo do interpretacji warunków niniejszej Umowy;
Użytkownicy mogą składać skargi i zgłaszać wszelkiego rodzaju naruszenia prawa i przepisów za pośrednictwem poczty elektronicznej, prosimy o wysłanie wiadomości e-mail na adres services@mcsl.com.cn.
